import React from "react";

export function Errors(props) {
  const { errors } = props;

  return (
    errors.length > 0 && (
      <div className="alert alert-danger">
        {errors.map((error, index) => (
          <p key={index}> {error.detail} </p>
        ))}
      </div>
    )
  );
}
